import React from 'react';
import { Link } from 'react-router-dom';

const AgriculturalPumps = ({ pumps, handleDeletePump }) => {
  return (
    <div>
      <h2>Agricultural Pumps</h2>
      {pumps.length > 0 ? (
        pumps.map((pump) => (
          <div key={pump.id} className="pump-item animate-on-scroll">
            <img src={`http://localhost:5001/uploads/${pump.image}`} alt={pump.name} />
            <div className="pump-info">
              <p className="pump-name">{pump.name}</p>
              <p className="pump-price">{pump.price}</p>
              <Link to={`/pumpDetails/${pump.id}`} className="read-more-btn">Read more</Link>
              <button className="delete-btn" onClick={() => handleDeletePump(pump.id, 'agricultural')}>
                Delete
              </button>
            </div>
          </div>
        ))
      ) : (
        <p>Loading Agricultural Pumps...</p>
      )}
    </div>
  );
};

export default AgriculturalPumps;
